const initialState = {
    data: [],
    filterData: []
};

export default function tableReducer(state = initialState, action) {
    switch (action.type) {
        case 'GET_DATA_SUCCESSFULL':
            return {
                data: action.payload,
                //filterData: action.state.payload
            }
        default:
            return state
    }
}
